import React from "react";
import "./index.scss";

const CommonSkills = ({ texts }) => {
    return (
        <div className="common-skills-noAuth">
            <h2>Habilidades Comuns</h2>
            <p className="desc-profiler">{texts.habilidades_comuns.texto}</p>
        </div>
    );
};

export default CommonSkills;
